const url = 'https://pokeapi.co/api/v2/pokemon'
export const GetAll = ()=>{
    //const pokemon ;
    fetch(url)
    .then(res => res.json())
    .then(res => console.log(res.results.name))
    .catch(err => console.log(err))
}
